import React, { useState, useEffect, useContext } from 'react';

import Step11Context from '../../../../store/step-eleven';

import classes from './FiveSliders.module.css';
import PersonalSlider from '../Slider/Slider';

const FiveSliders = ({ first, second, third, fourth, fifth, onValues, id }) => {
	const s11Ctx = useContext(Step11Context);
	if (id == '1' && s11Ctx.step1Sliders != null) {
		first = s11.step1Sliders[0];
		second = s11.step1Sliders[1];
		third = s11.step1Sliders[2];
		fourth = s11.step1Sliders[3];
		fifth = s11.step1Sliders[4];
	} else if (id == '1' && s11Ctx.step1Sliders != null) {
		first = s11.step1Sliders[0];
		second = s11.step1Sliders[1];
		third = s11.step1Sliders[2];
		fourth = s11.step1Sliders[3];
		fifth = s11.step1Sliders[4];
	}

	return (
		<section className={classes['five-sliders']}>
			<PersonalSlider
				title={first.title}
				id={first.id}
				value={first.value}
				onChange={onValues}
			/>
			<PersonalSlider
				title={second.title}
				id={second.id}
				value={second.value}
				onChange={onValues}
			/>
			<PersonalSlider
				title={third.title}
				id={third.id}
				value={third.value}
				onChange={onValues}
			/>
			<PersonalSlider
				title={fourth.title}
				id={fourth.id}
				value={fourth.value}
				onChange={onValues}
			/>
			<PersonalSlider
				title={fifth.title}
				id={fifth.id}
				value={fifth.value}
				onChange={onValues}
			/>
		</section>
	);
};

export default FiveSliders;
